[문의] 한화큐셀  질병위험가계도 관련문의.

기존 구매했던 알쓰패치가 남아있는데 가계도와 같이 체험자에게 사용해도 되는지 문의.

--->>답변:  검사방법과 체크가 노담패치와도 동일하기 때문에 별도의 안내가 추가 될 경우 , 사용해도 괜찮음.

가족력과 가족들의 질병위험,  알데히드 고위험체질을 알아보는 시간을 갖는 가계도 작성이기때문에  이와 관련 설명 추가 후 사용토록 권장해도 됨을 안내함.

////추가문의: 인체에 얼마나 미량인가?  ---->답변: 술 한잔 마시는것과 담배연기 마시는것에 비하면 아주아주 소량으로  신생아에게 알콜소독이 독할 수는 있지만 가능한것처럼 
위험하지 않음. 

